con:config.script:
def fileName = testRunner.testCase.getPropertyValue("FilePath")
def rootPath = context.expand("\${projectDir}") + "/"
File file = new File(rootPath + fileName)

def lines = file.readLines()
testRunner.testCase.testSuite.setPropertyValue("Total",lines.size().toString())

String [][] arr  = new String[lines.size()][]
for(i=0; i <lines.size(); i++){
	arr[i] = lines.get(i).split(",")
}
context.setProperty('Values', arr)

def total = testRunner.testCase.testSuite.getPropertyValue("Total").toInteger()
def counter = testRunner.testCase.testSuite.getPropertyValue("Counter").toInteger()
if (counter>=total){
	testRunner.gotoStepByName("EndScript")
	return
}

def array = context.getProperty("Values")

testRunner.testCase.setPropertyValue("Word",array[counter][0])
testRunner.testCase.setPropertyValue("CorrectWord",array[counter][1])
counter++
testRunner.testCase.testSuite.setPropertyValue("Counter",counter.toString())

